import React from 'react';
import ava from '../ava.png';
import '../profile.css'; 


function Profile(){
    return (
    <div className="leftdiv">
      <div className='img'>
        <img src={ava} alt="" />
      </div>
    </div>
    );
  }

export default Profile;
